import React from 'react';
import ReactDOM from 'react-dom';


const App = () => {
    return (
        <div>Hello There!</div>
    );
 }


// show my App component in the div with id=root  in my root index.html
 ReactDOM.render(<App />, document.querySelector('#root'));
